  {
    name:"alex",
    surname:"tyco",
    class:"3/B",
  },
  {
    name:"cahit",
    surname:"yzr",
    class:"6/C",
  },
  {
    name:"fatih",
    surname:"kara",
    class:"9/K",
  },
]

function App() {
  return (
    <div className="App">
      {
        students.map((item,index)=>{
          return(
            <Studentt key={index} item={item}/>
          )
        })

      }

    </div>


  );
}
export default App;
